import { useState, useEffect } from 'react';
import LoggedIn from "./LoggedIn";

function Home() {
    const [islogged, setIsLogged] = useState(false);
    const username = JSON.parse(window.localStorage.getItem('user-info'));
    useEffect(() => {
        if (window.localStorage.getItem('user-info') === null) {
            setIsLogged(true);
        }
    });
    const renderLoogedOut = (
        <>
            <h2>Welcome {username.name}</h2>
            <p>Thank you for taking the time to login. I hope </p>
        </>
    );
    return (
        <>
            {islogged ? <LoggedIn /> : renderLoogedOut}
        </>
    );
}

export default Home;
